-- ----------------------------
--  Table structure for `node`
-- ----------------------------
DROP TABLE IF EXISTS `node`;
CREATE TABLE `node` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(99) NOT NULL DEFAULT '',
  `parent_id` varchar(199) NOT NULL DEFAULT '0' COMMENT '竖线隔开的父id数组',
  `root_id` bigint(20) NOT NULL DEFAULT '0',
  `level` int(11) NOT NULL DEFAULT '0',
  `code` varchar(255) NOT NULL DEFAULT '' COMMENT '节点编号',
  `path` varchar(99) NOT NULL DEFAULT '' COMMENT '节点完整路径',
  `type` int(11) NOT NULL COMMENT '节点类型 房间或者一般节点',
  `area` double NOT NULL DEFAULT '0' COMMENT '房屋面积',
  `price` double NOT NULL DEFAULT '0' COMMENT '物管费单价',
  `fee` double NOT NULL DEFAULT '0' COMMENT '其他费用',
  `ownership` varchar(99) NOT NULL DEFAULT '',
  `contract` text NOT NULL,
  `remark` text NOT NULL COMMENT '备注',
  `weight` int(11) NOT NULL DEFAULT '0',
  `create_time` bigint(20) NOT NULL DEFAULT '0',
  `update_time` bigint(20) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1483 DEFAULT CHARSET=utf8;

